import test from './Logo.png'
const Project = ({github, projmanage, image, description}) => {
    return ( 
        <div className="flex flex-col gap-y-2 w-[240px] h-[340px] rounded-xl bg-[#30323d] pb-5  ">

            <div className='w-[200px] h-[300px] m-auto mt-3 bg-blue-200'>
            <img className="w-[100%] h-[100%] object-scale-down" src={test}></img>
            </div>

            <div className="flex h-10 w-fit m-auto gap-10 justify-evenly overflow-hidden">
            <button className='bg-blue-900 h-[100%] p-1 rounded-md' onClick={() => window.open("https://www.google.com")}>Code</button>
            <button className='bg-blue-900 h-[100%] p-1 text-center rounded-md'>Demo</button>
            </div>
            <div className="relative h-2/3 w-[90%] m-auto  rounded-lg bg-white">
            <p></p>
            </div>
        </div>
     );
}

export default Project;
